import React from "react";
import { AiOutlineInstagram,  } from "react-icons/ai";

function FooterBottomRight() {
    return (
        <div className="footer_bottom_right">
            <a href="https://post.naver.com/inflearn" target="_blank"><AiOutlineInstagram /></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><i className="fa-solid fa-b"></i></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><i className="fa-brands fa-instagram"></i></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><i className="fa-brands fa-youtube"></i></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><i className="fa-brands fa-facebook-f"></i></a>
            <a href="https://post.naver.com/inflearn" target="_blank"><i className="fa-brands fa-twitter"></i></a>
        </div>
    )
}

export default FooterBottomRight
